let messages = (m, result) => {

    for (let k in m.payload) {

        let v = m.payload[k]
        let t = m.topic + '/' + k
        let n = {topic: t, payload: v}

        if ((typeof v) == 'object') {

            let a = messages(n, [])
            result = result.concat(a)

        } else {

            result.push(n)

        }
    }

    return result
}

